import React, { useEffect, useState } from "react";
import { Button, Form, Input,Modal,Select,Space, TimePicker } from "antd";
import {useSelector} from 'react-redux';
import axios from "axios";
import { useNavigate } from "react-router-dom";
import styles from "./home.module.css";
import customParseFormat from 'dayjs/plugin/customParseFormat';
import { NotificationConfirmation } from "../notificationConfirmation";
export const SupervisorForm = () => {
  const [open, setIsOpen] = useState(false);
  const [form] = Form.useForm();
  const navigate = useNavigate();
  const [mechanicName,setMechnicName]=useState(null)
  const [time,setTime]=useState(null);
  const [hh,setHour]=useState(0);
  const [mm,setMinute]=useState(0);
  const [ss,setSecond]=useState(0);
  const data = useSelector(state=>state.pageReducer.data);
  const mechanic_name = useSelector(state=>state.pageReducer.mechanic_name);
  
  // useEffect(()=>{    
   
  //   // let m = today.getMinutes();
  //   // let m = today.getMinutes();
  //   // let s = today.getSeconds();
  //   console.log({hour:today.getHours(),minute:today.getMinutes(),second:today.getSeconds()})
  //   setTime({hour:today.getHours(),minute:today.getMinutes(),second:today.getSeconds()})
  // },[])
  
 
  const layout = {
    labelCol: {
      span: 8
    },
    wrapperCol: {
      span: 16
    }
  };

  const validateMessages = {
    required: "${label} is required!",
    types: {
      email: "${label} is not a valid email!",
      number: "${label} is not a valid number!"
    },
    number: {
      range: "${label} must be between ${min} and ${max}"
    }
  };
  useEffect(()=>{
    const today = new Date();
    setHour(today.getHours());
    setMinute(today.getMinutes());
    setSecond(today.getSeconds());
    // console.log(data,'inn superviser component++++++',mechanic_name)
  },[data])

  const { Option } = Select;
const handleChange = (value) => {
  // console.log(`selected ${value}`);
};

  const handleOk = () => {
    setIsOpen(false);
  };

  const handleCancel = () => {
    setIsOpen(false);
  };

  const onFinish = (values) => {
    if(values.breakdown_start_time==undefined){
      values.breakdown_start_time = moment().format('YYYY-MM-DD hh:mm:ss')
    }
      // console.log(values, "-----------");
    if (values) {
        localStorage.setItem('breakdown_start_time',moment().format('hh:mm:ss'))
        const {line_number,machine_number,mechanic_name,breakdown_start_time} = values;
        setIsOpen(true);
        axios
        .post('http://localhost:5000/api/supervisor', {
          line_number,machine_number,mechanic_name,breakdown_start_time
        })
        .then((response) => {
          // setPost(response.data);
        }).catch((err)=>alert(err,'error'));
        setTimeout(()=>{
          navigate("/notification_confirmation")
        },500)
      
    }
  };
  const onTimeChange=(time) => {
    console.log(time);
  }
  return (
    <div className={styles.section}>
       {data ? <div className={styles.container}>
       <h2 style={{textAlign:"center"}}>Supervisor</h2>
       
      <Form
      form = {form}
          className={styles.form_container}
          layout="vertical"
          name="nest-messages"
          onFinish={onFinish}
          initialValues={data}
          style={{
            maxWidth: 600
          }}
          validateMessages={validateMessages}
        >
          <Form.Item
            name="line_number"
            label="Line Number"
            rules={[
              {
                required: true
              }
            ]}
          >
            <Input  />
          </Form.Item>
          <Form.Item
            name="machine_number"
            label="Machine Number"
            
            rules={[
              {
                required: true
              }
            ]}
          >
            <Input  />
          </Form.Item>
         
          <Form.Item
            name="mechanic_name"
            label="mechanic"
            
            rules={[
              {
                required: true
              }
            ]}
          >
            <Input defaultValue={mechanic_name} />
          </Form.Item>
                <Form.Item
            name="breakdown_start_time"
            label="Breakdown Start Time"
           
          >
         {/* <TimePicker defaultValue={moment(`${time.hour}:${time.minute}:${time.second}`, 'HH:mm:ss')} size="large" disabled/> */}
         <TimePicker style={{display:"none"}} initialValues={moment(`${hh}:${mm}:${ss}`, 'HH:mm:ss')} size="large" disabled/>
          </Form.Item>
          
          <Form.Item
            wrapperCol={{
              ...layout.wrapperCol,
              offset: 3
            }}
          >
            <Button
              className={styles.submit_btn}
              type="primary"
              htmlType="submit"
            >
              Submit Record
            </Button>
          </Form.Item>
        </Form>
        <Modal open={open} title="Reset Password Using Email"
          onOk={handleOk}
          onCancel={handleCancel}>
        <NotificationConfirmation/>
      </Modal>
      </div>:<h1>Coming soon....</h1>}
     
      </div>
  );
};
